INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (0, 91002, "フリーマーケット会場", 2, 40, 7, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 1, "ペコリーヌとの出会い", 2834, 8, 0, "青空の下で謁見", 10118, 5118061);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (0, 91002, "フリーマーケット会場", 2, 40, 7, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 1, "マホとの出会い", 2835, 8, 0, "未来の騎空団\nマスコット？", 10118, 5118062);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (0, 91002, "ランドソル市街地", 2, 40, 7, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 1, "アキノとの出会い", 2837, 8, 0, "お嬢さまからの\n緊急依頼", 10118, 5118063);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (0, 91002, "フリーマーケット会場", 2, 40, 18, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 1, "ジュンとの出会い", 4108402, 8, 0, "黄金色の悩みごと", 10118, 5118064);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (0, 91002, "フリーマーケット会場", 2, 40, 18, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 1, "カオリとの出会い", 4107402, 8, 0, "白熱！　格闘大会！", 10118, 5118065);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (1, 91002, "オーエド町", 2, 40, 16, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 1, "ニノンとの出会い", 9000227, 8, 0, "祭り太鼓はオーエドの華", 10118, 5118066);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (0, 91002, "フリーマーケット会場", 3, 40, 19, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 1, "スズナとの出会い", 2101181, 8, 0, "人気者は遅れて\nやってくる", 10118, 5118067);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (0, 91002, "ランドソル市街地", 3, 40, 18, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 1, "ナナカとの出会い", 4109402, 8, 0, "巫女・ミーツ・魔法少女", 10118, 5118068);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (0, 91002, "フリーマーケット会場", 3, 40, 18, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 1, "キャル＆コッコロとの出会い", 4305402, 8, 0, "ネズ耳は二度なくなる", 10118, 5118069);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (0, 91002, "ランドソル市街地", 3, 40, 18, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 1, "ユカリとの出会い", 4101402, 8, 0, "この出会いにカンパイ！", 10118, 5118070);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (0, 91002, "ランドソル市街地", 3, 40, 18, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 1, "アオイとの出会い", 4106402, 8, 0, "陰陽アンサンブル", 10118, 5118071);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (1, 91002, "フリーマーケット会場", 3, 40, 7, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 1, "シノブとの出会い", 2836, 8, 0, "運試し十番勝負！", 10118, 5118072);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (0, 0, 0, 1, 0, 0, 0, 0, "オープニング", 0, 0, 10145115, "彼女たちの新たな日常", 10118, 5118600);
